var b="url",c="06_6_-_other_-_about_your_income.html",d="generationDate",e=new Date(1452074938290.16),f="isCanvasEnabled",g=false,h="variables",i="OnLoadVariable",j="EmailVar",k="FullnameVar",l="ContactnumVar",m="UrnVar1",n="UrnVar2",o="UrnVar3",p="UrnVar4",q="DayVar",r="MonthVar",s="YearVar",t="AcoomodationVAR",u="InsuranceVAR",v="UtilityVAR",w="CounilTaxVAR",x="TVVAR",y="TravelVAR",z="LoanVAR",A="ChildVAR",B="TelephoneVAR",C="CountyCourtVAR",D="NumChargesVAR",E="page",F="packageId",G="81527c50a6644eb392e6a8f4d4b85e96",H="type",I="Axure:Page",J="name",K="06.6 - Other - About your income",L="notes",M="Note",N="<p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">Title changed to:</span></p><p><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;color:#333333;\">About your income</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">&nbsp;</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">Grey box content changed to:</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">For this type of offence you'll usually have to pay a fine:</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">you must provide your income details</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">the court will decide your fine based on your finances and the seriousness of the offence</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">your details will be stored securely by the court</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"></span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">&nbsp;</span></p><p><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;color:#1E1E1E;\">What is the source of your main income?</span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\"></span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">For example, student loan, pension or investments.</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">Free form text box</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">&nbsp;</span></p><p><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;color:#1E1E1E;\">How often is your main income paid?</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"></span></p><p><span>Options are - Weekly, Fortnightly and Monthly</span></p><p><span>Based on the users selection the text on the next question will change to:</span></p><p><span>&nbsp;</span></p><p><span>Default wording - </span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">What is your take home pay (after tax)?</span></p><p><span>&nbsp;</span></p><p><span>If the user selects:</span></p><p><span>Weekly - text changes to - </span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">How much is your weekly take home income (after tax)?</span></p><p><span>&nbsp;</span></p><p><span>If the user selects:</span></p><p><span>Fortnightly - text changes to - </span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">How much is your fortnightly take home income (after tax)?</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">&nbsp;</span></p><p><span>If the user selects:</span></p><p><span>Monthly - text changes to - </span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">How much is your monthly take home income (after tax)?</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">&nbsp;</span></p><p><span>If the user selects:</span></p><p><span>Other - text changes to - </span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">What is your average weekly take home income (after tax)?</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">&nbsp;</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;\">When the user selects the continue button they are directed to the </span><span style=\"font-family:'.AppleSystemUIFontBold', '.AppleSystemUIFont BoldG3', '.AppleSystemUIFont';font-weight:700;\">Other with benefits - Pension Credit</span></p>",O="style",P="baseStyle",Q="627587b6038d43cca051c114ac41ad32",R="pageAlignment",S="center",T="fill",U="fillType",V="solid",W="color",X=0xFFFFFFFF,Y="image",Z="imageHorizontalAlignment",ba="near",bb="imageVerticalAlignment",bc="imageRepeat",bd="auto",be="favicon",bf="sketchFactor",bg="0"